// This is the C++ program that was used to generate the lookup
// tables in this file. In order to build this program you can
// e.g. add it to the test directory. If you add (or remove)
// pre-sieving primes in the bufferPrimes array please make sure
// to update getMaxPrime() in PreSieve.h afterwards.

#include <primesieve/EratSmall.hpp>
#include <primesieve/Vector.hpp>
#include <primesieve/macros.hpp>

#include <stdint.h>
#include <algorithm>
#include <cmath>
#include <iostream>
#include <iomanip>

using namespace primesieve;

/// Pre-sieve with the primes < 100
const Array<std::initializer_list<uint64_t>, 8> bufferPrimes =
{{
  {  7, 67, 71 },  // 32 KiB
  { 11, 41, 73 },  // 32 KiB
  { 13, 43, 59 },  // 32 KiB
  { 17, 37, 53 },  // 32 KiB
  { 19, 29, 61 },  // 32 KiB
  { 23, 31, 47 },  // 32 KiB
      { 79, 97 },  //  8 KiB
      { 83, 89 }   //  7 KiB
}};

int main()
{
  Array<Vector<uint8_t>, 8> buffers;

  for (std::size_t i = 0; i < buffers.size(); i++)
  {
    uint64_t product = 30;

    for (uint64_t prime : bufferPrimes[i])
      product *= prime;

    uint64_t start = product;
    uint64_t stop = start + product;
    buffers[i].resize(product / 30);
    std::fill(buffers[i].begin(), buffers[i].end(), 0xff);
    uint64_t maxPrime = *(bufferPrimes[i].end() - 1);
    ASSERT(maxPrime == *std::max_element(bufferPrimes[i].begin(), bufferPrimes[i].end()));
    ASSERT(start >= maxPrime * maxPrime);

    EratSmall eratSmall;
    eratSmall.init(stop, buffers[i].size(), maxPrime);

    for (uint64_t prime : bufferPrimes[i])
      eratSmall.addSievingPrime(prime, start);

    eratSmall.crossOff(buffers[i]);
  }

  std::cout << "const primesieve::Array<std::initializer_list<uint8_t>, 8> buffers =" << std::endl;
  std::cout << "{{" << std::endl;

  for (std::size_t i = 0; i < buffers.size(); i++)
  {
    std::cout << "  { ";
    for (std::size_t j = 0; j < buffers[i].size(); j++)
    {
      if (j != 0 && j % 20 == 0)
        std::cout << std::endl << "    ";
      std::cout << "0x" << std::hex << (int) buffers[i][j];
      if (j + 1 < buffers[i].size())
        std::cout << (((j+1) % 20 == 0) ? "," : ", ");
    }
    std::cout << (i + 1 < buffers.size() ? " }," : " }") << std::endl;
  }

  std::cout << "}};" << std::endl;
}

#endif

